import React from 'react';
import ReactDOM from 'react-dom/client';
import AuthContextProvider from './components/context/auth-context';


import './index.css';
import App from './App';

ReactDOM.render(
    <AuthContextProvider>
        <App />
    </AuthContextProvider>,
    document.getElementById('root')
);
